const { StyleSheet } = require("react-native");

module.exports = StyleSheet.create({
  Container: {
    padding: 25,
  },

  numberButton: {
    backgroundColor: "#FF5757",
    width: 20,
    height: 20,
    fontSize: 60,
    fontWeight: "bold",
    color: "#fff",
    justifyContent: "center",
    marginHorizontal: "auto",
  },

  operateButton: {
    backgroundColor: "#FF5757",
    fontSize: 30,
    fontWeight: "bold",
    color: "white",
    justifyContent: "center",
  },
});
